        {
			#region Code

			{ "AA", "Not registered - the Health Services Number for this patient is incorrect. Please recheck the Health Services Card and verify your claim details in the Person Health Registration System (PHRS). If appropriate, correct your claim details and resubmit through your vendor system." },
