            { "AF", "Incorrect first name and/or last name indicated on claim-Medical Services Branch (MSB) has paid this claim. Please use the name shown on the Health Services Card for future claims." },
            { "AG", "This claim is for a newborn (child less than one year old). The newborn may not be registered yet/or the patient identification data is incorrect. Please ensure the beneficiary data is correct or that the parents/guardians contact eHealth Registries at 1-800-667-7551 in order to have the newborn registered. If appropriate, correct your claim details and resubmit through your vendor system." },
            { "AH", "Please review this claim. Our records indicate that the beneficiary registered under this number died prior to the date of service." },
            { "AJ", "The services involving emergency room coverage cannot be paid as: 1) The physician is not eligible to bill these codes; 2) Another physician has been paid for the same time period in this community; 3) The incorrect dummy HSN has been used for this community; 4) An incorrect clinic has been used for this community; 5) ICD code must be Z56; 6) Location of Service must be 3; or 7) An incorrect service code, day of the week or amount has been used. If appropriate, correct your claim details and resubmit through your vendor system." },
            { "AM", "NO LONGER IN USE EFFECTIVE OCTOBER 1 2024: A letter sent to this patient by eHealth Registries regarding the validation renewal stickers has been returned. This patient will not have coverage after January 31. When you next attend to this patient, please advise them to immediately contact eHealth Registries at 1-800-667-7551 or 306-787-3251 to have their coverage updated. Please ignore this message if the patient now has a new expiry sticker." },
            { "AN", "The coverage for this patient has been terminated in accordance with their Canadian Immigration Authorization. All attempts to contact the patient have been unsuccessful. The date of service on the claim is after the termination date on the Health Services Card. In order to have the Health Services coverage updated, he/she should immediately contact Health Registration, 2130 11th Avenue, Regina, S4P 0J5." },
            { "AO", "A letter sent to this patient by the Ministry of Health has been returned. Therefore, the patient's coverage has been terminated. On your next contact with this patient, please advise the patient to immediately contact eHealth Registries at 1-800-667-7551 or 306-787-3251 to have their coverage updated." },
            { "AP", "NO LONGER IN USE EFFECTIVE April 1 2025: The 9-digit Health Services Number is incorrect. Please recheck your files and/or the patient's Health Services Card." },
