            { "AR", "Patient not registered for coverage on this date of service. Please check the effective and expiry dates on the Health Services Card. If the patient is a resident, they should immediately contact eHealth Registries, by phone at 1-800-667-7551 or 306-787-3251, 2130 11th Avenue, Regina, S4P 0J5, in order to have coverage updated. If the patient's coverage is updated as per the Person Health Registration System (PHRS), please resubmit the rejected claim through your vendor system." },
            { "AS", "Your account had to be split for processing. Payment for the listed services was approved based on the Ministry of Health's Payment Schedule." },
            { "AT", "Diagnosis and Payment Schedule service code are not compatible. If appropriate, correct your claim details and resubmit through your vendor system." },
            { "AU", "To assist in the assessment of this claim, a copy of the operative report, medical record or a descriptive letter is required. PLEASE NOTE: If an operative report is being submitted, it must contain surgical start and end times. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "AV", "This service is not insured." },
            { "AW", "This Payment Schedule service code applies to a certain location of service. The location of service you submitted is not compatible. Please verify. If appropriate, correct your claim details and resubmit through your vendor system OR Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information to support this unique billing scenario." },
            { "AX", "A Medical/Dental Consultant has reviewed this claim. The circumstances described are not considered sufficient to warrant additional payment. If there are further relevant details, please submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "AY", "Assessed by a Medical or Dental Consultant." },
            { "AZ", "1) Please refer to correspondence sent to the physician or clinic. If you have questions, please contact the Business Support Desk at 1-800-605-2965; or 2) This code may have been rejected as a procedure that is 'normally only performed once' (i.e.: total bilateral thyroidectomy) or only repeated after a reasonable interval (i.e.: delivery), please verify service code submitted for accuracy. If appropriate, correct your claim details and resubmit through your vendor system OR Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information to support this unique billing scenario." },
            { "BA", "Duplicate - same physician/dentist/optometrist - payment has been made for the same service provided on the same day. Use Query Claims in Customer Portal to review this patient's claim history. To search, use the patients HSN, Province, your Billing and Group Number to display all claims processed and their status. This will display your claim history (paid, pended or rejected) and locate any/all duplicate submissions." },
            { "BB", "Possible duplication of a payment for a similar service. If no duplication, submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "BC", "Duplicate - same clinic - payment has been made to another physician/dentist/optometrist in your clinic for a similar service on the same day. Please check your records. If appropriate, submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "BD", "PHYSICIAN/DENTAL: The beneficiary has been paid for a similar service provided on the same day. OPTOMETRIST: The beneficiary has been paid, based on the claim previously submitted." },
            { "BE", "This payment schedule service code and/or diagnostic code applies to a specific age and/or sex." },
            { "BF", "Adjustment based on correspondence - Re: 'Audit of Services'." },
            { "BG", "PHYSICIAN / DENTAL: This Payment Schedule service code was submitted at less than the listed rate. 1) If this claim has been returned to you, please correct and submit at the current rate. 2) If this claim has been adjusted by Ministry Officials, the appropriate rate for the date of service has been approved. OPTOMETRIST: Billed less than Listed Payment -- appropriate payment for the date of service has been approved." },
            { "BH", "Payment Approved at: 1) Payment Schedule listed rate in effect for the date of service based on your specialty. 2) The referred rate because a valid referring physician was provided. 3) The unreferred rate because of one of the following: The 4-digit referring doctor is not valid; We could find no record of the 'referring physician' being licensed to practice; or No referring doctor number was submitted." },
            { "BI", "NO LONGER IN USE EFFECTIVE OCTOBER 1 2024: Paid at the unreferred rate because of one of the following: 1) The referring physician has not practised in Saskatchewan during the past two years; 2) The 4-digit referring doctor is not valid; 3) We could find no record of the 'referring physician' being licensed to practice; or 4) No referring doctor number was submitted." },
            { "BJ", "PHYSICIAN/OPTOMETRIST: Payment for this item can only be made if the patient was referred and the 4-digit referring doctor number is indicated in the appropriate field. Please re-submit: 1) if referred, with the 4-digit referring doctor in the appropriate field; 2) if unreferred, using appropriate code and fee. DENTAL: Unreferred patient - payment for this item can only be made if the patient was referred and the 4-digit referring practitioner number is indicated in the appropriate field. Please re-submit: a) If referred, with the 4-digit referring practitioner or Cleft Palate Clinic in the appropriate field; b) If unreferred, using appropriate code and fee." },
            { "BK", "PHYSICIAN / OPTOMETRIST: Payment based on the service code and related payment approved by the Ministry of Health. DENTAL: The current service code you submitted is inconsistent with previously paid services." },
            { "BL", "1) This service is currently being discussed with the Saskatchewan Medical Association Tariff Committee; OR 2) This item is not currently an insured service; please contact the Saskatchewan Medical Association Tariff Committee to apply for a new service code." },
            { "BM", "Unilateral/bilateral procedure--please re-submit indicating left/right or bilateral." },
            { "BN", "You were asked for additional information to assess this claim, no reply received -- without this information, the claim cannot be processed." },
