            { "BP", "Payment adjustment based on: 1) Your resubmission; 2) Our review of assessment; 3) Information received through Query Claims - Supplementary Claim Information; OR 4) Your Request for Recovery of this Claim through Query Claims - Physician Requested Recovery." },
            { "BQ", "The service code and/or amount submitted are incorrect. Please review and resubmit." },
            { "BR", "Blank or invalid service code -- please review." },
            { "BS", "The service code submitted is not correct for the condition described; or the service(s) provided." },
            { "BT", "Approved at the maximum amount consistent with your description of the service provided." },
            { "BU", "Payment not approved for: 1) Surcharge alone; 2) Surcharge with: a) another surcharge code: 615A, 721A, 815A, 816A, 817A, 818A, 819A, 836A, 837A, 838A, 839A or 915A; b) Service codes 41A, 56A, 60A, 70A, 71A, 74A, 80A, 81A, 153A-156A, 184A, 190A-198A, 600A, 627A-629A, 680A, 681A, 708A-710A, 714A-718A, 725A-727A, 753A, 770A 42B-44B, 60B-68B, 73B, 85B, 200B, 205B, 206B, 207B, 30D, 31D, 32D, 130D, 131D, 145D, 278D, 279D, 281D-285D, 290D, 291D, 320D, 43E, 142E, 144E, 400H-424H, 667H, 80J-81J, 278K, 279K, 452L, 31M, 42O, 44O,  260P, 261P, 300T; c) hospital care codes, including newborn care, supportive care (52B-53B); d) a pre-arranged service; and e) phone calls or faxes (70A, 761A-769A and 790A-795A, 796A, 797A). 3) Surcharge for an extra patient not paid for the day and time indicated. 4) Premium service codes should not be submitted based on the eligible service codes being paid. They are automatically generated by the Ministry of Health. 5) Surcharges for emergency room physicians providing emergency room shif ts or first on-call services. 6) Hospital care surcharge: 700A for non-statutory holidays, and 701A if not Saturday or Sunday. 7) Extra patient surcharge not paid with 335H to 339H. Initial patient surcharges paid only once per patient per day." },
            { "BV", "Premium or non-premium payment based on the appropriate service code and amount listed for the date and times provided." },
            { "BW", "Billed more than listed payment - appropriate payment for the date of service has been approved." },
            { "BX", "This is a time-based service: 1) Time requirements have not been met; therefore, no payment can be made; or 2) The service code descriptor states 'greater portion thereof' or 'major portion thereof', and the greater/major portion of the time component has not been met; therefore, the additional time units are not payable; or 3) Start and Stop Times provided do not correspond to the number of units billed. If appropriate, correct your claim details and resubmit through your vendor system." },
            { "BY", "Payment on a time basis--please designate the treatment time and resubmit." },
            { "BZ", "PHYSICIAN: Payment is based on the amount payable to a Saskatchewan physician in the same specialty providing the same or similar service. OPTOMETRIST: Payment is based on the amount payable to a Saskatchewan optometrist providing the same service. DENTAL: Payment is based on the amount payable to a Saskatchewan dentist in the same specialty providing the same or similar service." },
            { "CA", "PHYSICIAN: Services not insured by the Ministry of Health: Medical examinations, services and provision of certificates or reports requested by a third party, e.g. for: - Attendance at camps - Autopsies - Daycare - Employment - Employment Insurance Program - Insurance - Judicial purposes (other than adoption or commitment) - Motor vehicle or other license (MSB pays some services for SGI) - Participation in Sports - Passport or Visa - Seat belt exemption - Third party counselling - University or private school entrance OPTOMETRIST: Non-Insured Services: Examinations or services to provide certificates or reports requested by a third party are not insured, e.g., for: - Attendance at camps, - Employment, - Employment insurance programs, - Participation in Sports, - Insurance, - Judicial purposes, - Motor vehicle or other licenses (see 23U)" },
            { "CB", "PHYSICIAN: Services not insured by the Ministry of Health: Materials & other services -- e.g.: - Acupuncture - Advice by telephone or letter(most) - Ambulance services - Anesthetic materials - Appliances (Prostheses) - Casts - Committee or Advisory service - Contractual Service for a government department or agency - Dentistry - Dressing or medication - Drugs - Eyeglasses or Contact Lenses - Facility fee - Medical testimony in court - Medical-legal opinion and report - Secretarial or reporting fee(s) - Services by a special duty nurse - Surgical supplies - Travel by a physician - Tray service (see service codes 897L and agency 899L for description) OPTOMETRIST: The following are not insured: - Advice by telephone - Appliances (Prostheses) - Committee or advisory service - Contractual service for a government department or agency - Eye glasses (fitting, frames or lens) - Medication - Secretarial or a reporting fee - Travel by an optometrist. DENTAL: Materials & other services - e.g.: Advice by telephone, Drugs , Anesthetic materials, Secretarial or reporting fee(s), Appliances (Prostheses), Surgical supplies, Dressing or Medication, Tray service" },
            { "CC", "Immunization services--when available under the Ministry of Health programs. If this patient was referred by the Ministry of Health personnel or there are medical factors which prohibited immunization under the Ministry of Health programs, please resubmit with an explanation." },
            { "CD", "PHYSICIAN: Hospital Services: 1) Services provided by: a) Hospital personnel; or b) Any out-patient facility having a contract with the Ministry of Health. 2) The technical component of a diagnostic procedure performed in a hospital utilizing hospital equipment, e.g. ECG, EEG. DENTAL: Extraction of teeth is not an insured service except when : a) The extraction of teeth is necessary to be performed prior to the provision of heart surgery services, services for chronic renal disease, prior to or following head and neck cancer services or services for total joint replacement by prosthesis, or in conjunction with Cleft lip and Palate repair/grafting/orthodontic realignment or, b) As a result of cancer radiation treatment within five years where the patient has followed the recommended guidelines of the radiation oncologist and of the dentist in relation to recommended dental hygiene and care; or c) Prior to stem cell transplants; and, d) The beneficiary is referred to the dentist by a specialist in the field of practice in which the services lie; and e) The specialist recommends that payment be made for the service." },
            { "CE", "PHYSICIAN: A service by a physician who is not registered with or licensed by the appropriate agency of the Province, State or Country on the date the service was provided; or Based on an undertaking or license restriction imposed by the College of Physicians and Surgeons of Saskatchewan, this service is not payable to this physician. For more information, contact Policy, Governance and Audit. OPTOMETRIST: Non-Registered Provider of Service -- a service is not insured by MSB if it was provided by an optometrist or a graduate student who is not registered with or licensed by the appropriate agency of the province, state or country in which he practices DENTAL: A service by a dentist who is not registered with the College of Dental Surgeons of Saskatchewan on the date the service was provided." },
            { "CF", "This service code is not valid for this date, because it is either: 1) Prior to implementation; or 2) After deletion from the Payment Schedule." },
            { "CG", "PHYSICIAN: Your claim has been rejected for payment and no further action is required. Per The College of Physicians and Surgeons of Saskatchewan's Bylaws (7.1) and Code of Ethics item (7), physicians must: Limit treatment of yourself, your immediate family, or anyone with whom you have a similarly close relationship to minor or emergency interventions and only when another physician is not readily available; there should be no fee for such treatment. Medical Services Branch routinely reviews services billed by physicians on family members (as registered in the same family unit by Health Registries) or themselves. In certain circumstances, as deemed necessary by MSB officials, this information is forwarded to the College of Physicians and Surgeons for further investigation. OPTOMETRIST: Optometrist billing for his immediate Family -- a service is not insured when provided by an optometrist to himself or any member of his immediate family. Reference: Regulations under the Medical Care Insurance Act. DENTAL: Dentist Billing - Own Family  Payment is not approved for services provided by a dentist to himself, his spouse or any of his dependents. (Ref: Regulations under The Saskatchewan Medical Care Insurance Act)" },
            { "CH", "These services appear to be the responsibility of the Department of Veteran's Affairs (DVA). Please send the appropriate form to DVA: Treatment Benefit Unit, Box 6050, Winnipeg, R3C 4G5. If they do not accept responsibility, please resubmit the claim electronically indicating 'D' in the claim type field to indicate not DVA responsibility." },
            { "CI", "PHYSICIAN: The service provided cannot be paid for an out-of-province beneficiary; it is on the excluded list of services for reciprocal billing purposes or it cannot be billed under the reciprocal billing process. OPTOMETRIST: The service provided cannot be paid for an out of province beneficiary; there is not reciprocal billing process for optometric claims" },
            { "CJ", "Our records indicate this patient was not in the hospital on this date. If this information is incorrect, please resubmit with the admission and discharge dates." },
            { "CK", "This service is not insured - our records indicate that the beneficiary died more than 30 days prior to date of service." },
            { "CL", "In-hospital services for which payment may be funded by the Ministry of Health." },
            { "CM", "Claims received more than six months after the date of service. A resubmitted claim must be returned within one month. Resubmitted claims must include original claim number and the date of the original submission. If factors beyond your control prevented submission within six months, the following details must be received in writing addressed to the Manager, Claims Unit. Submit the required information through Customer Portal using Query Claims - Supplementary Claim Information - Request for extension of time limit (Explan code CM-CN). Please include - 1) List of claims for which you are requesting the time limit approval; 2) Service codes and dollar amounts; 3) Number of Patients; 4) Dates of service; 5) Circumstances for the delay in submitting your accounts; and 6) Date of submission." },
            { "CN", "PHYSICIAN/ DENTAL: Claims received more that 12 months after the date of service cannot be accepted for any reason. OPTOMETRIST: Claims received more than 12 months after the date of service cannot be accepted for any reason. Reference: Medical Care Insurance Act, Section 14A and Related Regulations." },
            { "CO", "Date of Service is prior to: 1) The physician's registration date; OR 2) The effective specialty date as indicated by the College of Physicians and Surgeons of Saskatchewan." },
            { "CP", "Our latest information from the College of Physicians and Surgeons of Saskatchewan indicates that you are registered in Saskatchewan as a General Practitioner." },
            { "CQ", "Quebec does not participate in the Inter-Provincial Reciprocal Billing Agreement for physician services. Please bill the patient directly." },
            { "CS", "Department of Veterans' Affairs - has advised the Ministry of Health that they have paid you for this service." },
            { "CT", "PHYSICIAN: Workers' Compensation Board has advised the Ministry of Health that they have paid you or another physician in your clinic for the same service, a similar related service or a service which includes post-operative care. OPTOMETRIST: Workers' Compensation Board (WCB) has advised MSB that they have paid you for this service." },
            { "CU", "PHYSICIAN: Payment is based on one of the following: 1) Payment is only approved for those physicians listed by the College of Physicians and Surgeons of Saskatchewan, State Board, Saskatchewan Health Authority or Saskatchewan Medical Association Tariff Committee in their practice locale as having qualified to receive payment for this service or approved according to requirements listed for a particular service code. 2) List I and II laboratory services are only payable when provided in a medical laboratory which holds a Category I licence issued pursuant to The Medical Laboratory Licensing Act. DENTAL: Payment is only approved for those dentists listed by the College of Dental Surgeons of Saskatchewan as having qualified to receive payment for this service." },
            { "CV", "Practitioner is ineligible to bill or registration not completed." },
            { "CW", "These services appear to be the responsibility of the Workers' Compensation Board (WCB.). Please submit a claim to the WCB at Suite 200 - 1881 Scarth Street, Regina, S4P 4L1. If they do not accept responsibility, WCB will forward the claim to you. If the claim has not yet been paid, please submit an automated claim to MSB indicating 'W' in claim type field to indicate not WCB responsibility and a comment indicating the date submitted to and rejected by WCB." },
            { "CY", "This service not usually billed by a physician in your specialty." },
            { "CZ", "The 20A and other associated visits, laboratory services, 131A, 204A, 205A, 206A, 30D, 31D, 32D and 815A-839A can be on the same claim number and should be submitted with a diagnostic code of Z90 (Examination-Third Party Request from the Ministry of Social Services). Also a diagnostic code of Z90 should only be used in conjunction with a claim containing a service code of 20A. If appropriate, amend your claim details and resubmit through your vendor system. OPTOMETRIST: Services in relation to the wearing or provision of contact lenses other than a routine eye refraction (2U, 4U) are not insured." },
            { "DA", "Only one visit type service is approved during a single patient contact. If there were 2 separate patient contacts, please provide reason and time of the second visit. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
