            { "DK", "Third party counselling billed under codes 15C/16C must be billed under the name of the child (not the parent/caregiver/relative, etc) regardless of who is being counselled." },
            { "DL", "Surcharge 721A applies to a life-threatening situation and admission to hospital -- the information given on your claim does not indicate the necessity for an immediate 'STAT' response regarding a life-threatening situation. Your surcharge may have been adjusted to another surcharge based on the information provided. If appropriate, correct your claim details and resubmit through your vendor system OR Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information to support this unique billing scenario." },
            { "DM", "Service codes 220A-226A, 918A, 919A, 926A-928A, 335H-339H relate to the time actually spent with the patient, and all services provided during this time. Please indicate: 1) Time when service started and was completed. 2) Clinical factors necessitating the personal attendance/indirect care/resuscitation. 3) Services provided during that time. If appropriate, correct your claim details and resubmit through your vendor system OR Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information to support this unique billing scenario." },
            { "DN", "Surcharge 721A does not apply where the patient is already hospitalized." },
