            { "DP", "Service codes 220A-226A, 918A, 919A, 926A-928A, 935A, 936A, 335H to 339H and most 400H-424H services -- include all services provided during this time. Payment based on your description of services." },
            { "DQ", "Additional patient--payment has been previously approved for a special call made to another patient at the same location on the same date. If you were 'specially called' a second time and returned to provide this specific service please resubmit for the difference in payment under the initial service code with a notation confirming the return visit." },
            { "DS", "Service codes 220A-226A and 918A are not paid when other service codes apply." },
            { "DT", "Continued hospital care - payment is based on continuous hospital care. 1) Assessment Rules - 'Hospital Care', #2." },
            { "DU", "Our records indicate that the beneficiary was a hospital in-patient on the date of service. a) Payment adjusted to the appropriate item for hospital care. b) Payment rejected. Please verify location of service. If appropriate, correct your claim details and resubmit through your vendor system OR Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information to support this unique billing scenario." },
            { "DV", "926A applies to the actual time spent in transit with the patient. Please resubmit indicating: 1) Location from which patient was transferred, 2) Location of hospital to which patient was transferred, 3) Times of departure and arrival." },
            { "DW", "Multiple visits--hospital--the payment for daily in-hospital care is a maximum regardless of the number of visits made by the physician. 1) Assessment Rules - 'Hospital Care', #1." },
            { "DX", "Concurrent care -- payment has been made to another physician for daily hospital care for this period. Payment to a second physician is only approved when a satisfactory explanation is provided that care by two physicians was required. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "DY", "Special Call or emergency visit--in-hospital care- will not be approved for a hospital in-patient without additional information. Please resubmit with an indication of the factors requiring the visit. Re: 'Assessment Rules' - 'Hospital Care', #4." },
            { "DZ", "READMISSION must be indicated in order to be eligible for the higher rate of payment when a patient is readmitted within 14 days. Re: Assessment Rules - 'Hospital Care', #2." },
