            { "EL", "PHYSICIAN: Consultation converted to a partial/follow-up assessment. Re: Assessment Rules - 'Consultations', #6 (b) VIRTUAL CARE PILOT: Virtual consultation converted to a virtual partial/follow-up assessment. Re: Assessment Rules - 'Consultations', #6 (b) and (d) and #7." },
            { "EM", "Complete/initial assessment converted to a partial/follow-up assessment. Re: Assessment Rules - 'Consultations', #6 (c),(e), and (g)." },
            { "EN", "PHYSICIAN: Consultation converted to a complete/initial assessment. Re: Assessment Rules - 'Consultations' - #6 (d) and #7. DENTAL: A 200Z is not payable unless it is provided in conjunction with an insured oral surgery service." },
            { "EO", "An initial in-hospital consultation on the same day or within 42 days after a complete/initial assessment is converted to a complete/initial." },
            { "EP", "An initial in-hospital consultation on the same day or within 90 days after another consultation is converted to a complete/initial assessment." },
            { "ER", "Your claim has been assessed based on one of the following: 1) A previous 52B has been paid for this admission; only 1 payable. If this is a readmission, resubmit indicating the date of admission/discharge. 2) Second 53B is not payable within six days. 3) This patient does not appear to be under the care of a specialist or a GP Hospitalist from an approved site; please resubmit with the name of the attending specialist or GP Hospitalist. 4) 52/53B is not payable based on other service code criteria listed in the Payment Schedule." },
            { "ES", "A follow-up visit on the day of a 42-day elective procedure, is not approved when seen by the physician within the previous 30 days." },
            { "ET", "Per 'Hospital Care' item (2): Payment will be made as if hospitalization has been continuous when a patient is transferred during the same admission to either a specialist in the same specialty or a general practitioner. Consultations and visit services are not payable for transfers of care in these circumstances" },
            { "FA", "Paid at the greater of the procedure or visit/consultation. 1) Assessment Rules - 'Multiple Services', Rule 1. 2) Payment Schedule Listing." },
