            { "FG", "Multiple interpretations billed on the same date. Please resubmit indicating if these interpretations are for tracings done on different days, the time and reason for multiple interpretations." },
            { "FH", "PHYSICIAN: Technical component not approved. In order for a physician to be eligible for payment of technical fees: - The physician must personally own the equipment and employ staff performing the testing (if testing is being performed by staff) as technical components are intended to offset physician costs associated with performing the service. If physician owns equipment and employs staff, please resubmit with this information. - It must not be performed in any part of a hospital. Only the interpretation component can be approved when this service is provided in any part of a hospital. If not provided to either an inpatient or an outpatient, please resubmit designating the locale. DENTAL: Service is not insured as it was provided outside a hospital." },
