            { "FT", "Code 34F, PUVA therapy, is paid once only on alternate days. Repeat billings are converted to 150A." },
            { "FY", "A code and a fee have been approved by the Ministry of Health that are not yet available for billing. A temporary code has been used to process your claim." },
            { "FZ", "The calculated premium is based on the submitted service code and is paid as the premium approved service code. The amount has been calculated using the appropriate premium percentage multiplied by the approved amount plus the age (or pediatric) supplement when calculating time of day premium of the eligible service code." },
            { "GA", "This claim has been assessed by a Medical Consultant. No further action will be undertaken by MSB unless further review is formally requested in accordance with the policy outlined under 'Assessment of Accounts' - point 1(a) - of the Physicians Payment Schedule. Requirements for review by a Medical Consultant are: - Written request for review including rationale for additional consideration; - New Information which supports Request for Review; and/or - Operative Record indicating start and stop times for procedure. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "GB", "This claim has been reviewed by a Medical Consultant. The documentation provided does not support the code(s) submitted. No further action will be undertaken by MSB unless new information is submitted which supports the claim(s). Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "GC", "PHYSICIAN: This claim is being reviewed by a Medical Consultant. Please provide a copy of the medical record/operative report within 90 days. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information. DENTAL: To assist the Dental Consultant in the assessment of this service, please submit orthodontic treatment plan, photos of full records, and a list of the codes you wish to bill under the treatment plan. The Practitioner should not start billing active treatments until Medical Services has reviewed the records. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "HA", "Based on the total payment (calculated at the specialist rate, regardless of 'repeat surgery rule' or surgery by a general practitioner) for the procedure(s) performed. Re: Section 'H', item 3." },
