            { "JE", "Payment for more than one surgical assistant is not approved for this type of surgical procedure unless special circumstances satisfactory to the Ministry of Health are described. Re: Section 'J', item 3." },
            { "JF", "This claim is rejected as the surgery claim has not been received or the surgery submitted is not eligible for the type of assist billed. Please contact the surgeon. - When the surgery is submitted by the surgeon, MSB will readjudicate your claim. Do not resubmit. - If surgery is not eligible for the type of assist billed, please resubmit a new claim." },
            { "JG", "1) 80J/81J are for office-based physicians who earn less than 50% of their income submitted and paid through the MSB billing system from surgical assisting. 2) 80J/81J is for scheduled surgeries performed between 8:00 am and 5:00 pm, Monday to Friday. If your claim has been rejected or converted to another surgical assistance code, it is because: a) The service was not provided between 8:00 and 5:00 pm Monday to Friday; b) The service was billed with a premium location (B, K, M, C); c) The service was billed with a surcharge (815A-839A); d) The physician was not eligible to bill this service because he does not earn less than 50% of his/her income through surgical assisting; e) The service was billed on a statutory holiday or weekend." },
            { "JH", "Service codes 540H, 545H, 580H, and 585H are not billable by the surgical assistant with 'J Section' codes. These service codes are only payable to the anesthetist who is providing the anesthetic service with H section codes." },
            { "JJ", "BMI supplements are not billable by the surgical assistant with 'J Section' codes." },
