            { "KJ", "NO LONGER IN USE EFFECTIVE April 1 2025: This service is not payable unless all required components of the code are fulfilled and documented, as outlined in the Physician Payment Schedule. No further action will be undertaken by MSB unless new information is submitted which supports the service(s) billed. If you are unsure about what is required, please contact the Claims Analysis Unit" },
            { "KM", "Diagnostic procedure on the day of a '42' Day procedure approved at 75%. If the diagnostic procedure is a greater value than the 42 day procedure ,the diagnostic procedure is payable at 100% and the 42 day procedure at 75%. Re: Assessment Rules - 'Multiple Services', Rule 6" },
            { "KN", "Related diagnostic procedure during the designated post-operative period of a '10' or '42' Day procedure approved at 75%. Re: Assessment Rules - 'Multiple Services', Rule 7" },
            { "KO", "PHYSICIAN: The two days of pre-operative care in hospital are included in the payment for a '10' or '42' Day procedure. DENTAL: Pre-operative care in hospital is included in the payment for a '10' or '42' day surgical procedure. Re: Assessment Rules -- 'Surgery Rule 3'" },
            { "KP", "Visit (including hospital care) or consultation, same day, is included in the payment for a '42' Day procedure when provided by the same physician, another physician in same specialty and clinic or part of the team. Re: Assessment Rules - 'Multiple Services', Rule 3" },
            { "KQ", "PHYSICIAN: Inpatient visits (including hospital care) or consultation during the designated post-operative period of a related '10' or '42' Day procedure is included in the payment for procedure when provided by same physician, a general practitioner in the same clinic or a specialist in the same specialty and clinic. Re: Assessment Rules - 'Multiple Services', Rule 4. OPTOMETRIST: Post-Operative Visit following major eye surgery is an inclusion within the payment to the surgeon in the same clinic. DENTAL: Visit services for the same or a closely related condition during the normal period of post-operative care for a '10' or '42' day procedure are included in payment for the procedure, when provided by the surgeon or any dentist. Re: Assessment Rule - Surgery #1B." },
            { "KR", "Only one special call is approved per major surgical procedure or dislocation" },
            { "KS", "Codes 232L and 142P are only payable for Malignancy. Code 142P is only payable in addition to 123P or 134P" },
            { "KV", "This service is not payable unless necessary criteria of the code is documented on the claim. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "LA", "348L included in payment for 355L" },
