            { "PB", "Included in the payment for delivery and post-natal care in hospital. Re:'Obstetrics', item 4(a-g)" },
            { "PC", "A therapeutic abortion code (50P, 250P) was billed with an office location. Codes 50P (first trimester) and 250P (second trimester) are designated as '42-day' surgical procedures and can only be billed for the provision of performing surgical abortions. If a surgical procedure was performed, please resubmit with the correct location of service (outpatient or inpatient). 50P and 250P cannot be billed for administering or prescribing pharmaceutical abortion agents such as mifepristone and misoprostol. See service code 150B and 351P for the administration and medical management of pharmaceutical abortion agents" },
            { "PG", "42P approved - patient was turned over to consultant who provided the delivery. Re: 'Obstetrics', item 2" },
