            { "PS", "Two complications of pregnancy may be claimed per patient per pregnancy. Report required for more than 2. Submit the required additional information through Customer Portal using Query Claims - Supplementary Claim Information." },
            { "PU", "Continuous personal attendance is not paid with a delivery" },
            { "QA", "1) The claim submitted has hospital dates that span two different Payment Schedule rates. Please resubmit claim(s), with correct fees for the date(s) of service; or 2) This claim has laboratory services and an ECG service; please resubmit with the ECG on a separate claim" },
            { "QB", "The fee submitted is incorrect for the Payment Schedule rate in effect on the date of service. Please update your system with the current Payment Schedule rate(s) OR if you've already updated your system with the new rate(s), please check the date of service if it is prior to the effective date of the new rate, and then resubmit your claim with the correct fees" },
            { "QC", "Number of units submitted is incorrect. Either this service does not have units or the number of units is greater than listed in the Payment Schedule. Resubmit with the correct number of units and fee. Services which do not have units must be submitted on an individual line" },
            { "QD", "Please review and resubmit when appropriate: - This service code applies to a specific day and/or time. OR - 700A is only billable on a Statutory holiday (or on the day designated in lieu, when the statutory holiday falls on a Saturday or Sunday). OR - 701A is only billable on a Saturday or Sunday. Resubmit with the correct date of service" },
            { "QE", "This service code must be billed in conjunction with a base code. Please review the Payment Schedule and code descriptor. Resubmit your amended claim in the next billing cycle" },
            { "RA", "To assist Ministry officials in the routine monitoring and review of practitioner payments, please provide a copy of the medical record and/or the appropriate documentation within 30 days to support this billing. Please refer to the 'Routine Audit and Recovery' preamble in the current Physician Payment Schedule for further information" },
            { "RB", "This adjustment for repayment or recovery is being made as a result of a routine audit undertaken by Policy, Governance and Audit of Medical Services. For inquiries related to this payment, contact PGA" },
            { "RC", "This claim is being returned/recovered as it is currently under review as a part of a routine audit. Policy, Governance and Audit (PGA) will adjudicate this claim and make the appropriate adjustment, if warranted. Do not resubmit electronically. For inquiries related to this audit, contact PGA" },
            { "RD", "This service appears to have been pre-planned/pre-arranged. If the claim was billed with a surcharge (815A-839A or 721A), within 30 days please provide the medical record that supports: a) the time of day that the service was provided; b) the physician's location when they were called out; and c) the reason for the special call" },
            { "RE", "This service was billed with a time-of-day premium (B, C, D, E, F, K, M, P, T). Within 30 days, please provide the time that the service was provided, including documentation that supports the location of service billed and time that the service was provided. If the documentation submitted for review does not support the location of service provided, payment will be made with a non-premium location of service" },
            { "RF", "A special call/surcharge (815A to 839A) was billed. Within 30 days, please provide: a) the time of day that the service was provided; and b) the physician's location when they were called out; and c) the reason for the special call" },
            { "RG", "This service is being recovered or converted as a result of a routine audit pertaining to 540H (anesthetic premium for cases starting before 5:00 p.m. and ending after 5:00 p.m). a) If you have indicated that the anesthetic start time was before 5:00 pm on a weekday, AND you have billed 500H-507H with a time-of-day premium (B, C, K, M, etc), the service is not eligible for a time-of-day premium and your claim is being converted to a nonpremium location of service. b) If you have indicated that the anesthetic start time was after 5:00 p.m. on a weekday, then 540H is not eligible for payment and this service is being recovered. c) If you have not indicated a start time, please provide the start time and submit to PGA for review" },
            { "RH", "This service is being recovered or converted as a result of a routine audit pertaining to 545H (anesthetic premium for cases starting before 12:00 a.m. and ending after 12:00 a.m.). a) If you have indicated that the anesthetic start time was before 12:00 a.m., AND you have billed 500H-507H with a time-of-day premium (K, M), the service is not eligible for a 100% time-of-day premium and your claim is being converted to the appropriate premium (B, C). b) If you have not indicated a start time, please provide the start time and submit to Policy Governance and Audit (PGA) for review" },
            { "RI", "This service is being recovered as a result of a routine audit pertaining to injection services. If this service is for a routine, regularly scheduled visit for the purpose of providing an injection service (110A, 131A, 161, etc), please resubmit as the appropriate injection code. If the partial assessment (5B) was medically required and meets all of the Payment Schedule criteria, submit to a copy of the medical record to PGA for review within 30 days. See PGA contact information in preamble" },
            { "RJ", "The Ministry of Health performs post-JMPRC audits to ensure compliance with the Joint Medical Professional Review Committee's recommendations, and to ensure that the service codes submitted to the Ministry for payment meet the requirements as set out in the Physician Payment Schedule, the physician's Direct Payment Agreement with Medical Services Branch and The Saskatchewan Medical Care Insurance Act. To assist Ministry officials in the routine post-JMPRC monitoring and review of physician payments, please provide a copy of the medical record and/or the appropriate documentation to support this billing. Please see correspondence from Policy Governance and Audit (PGA) if more information is required. See PGA contact information in preamble" },
            { "RK", "The Ministry of Health performs post-JMPRC audits to ensure compliance with the Joint Medical Professional Review Committee's recommendations, and to ensure that the service codes submitted to the Ministry for payment meet the requirements as set out in the Physician Payment Schedule, the physician's Direct Payment Agreement with Medical Services Branch and The Saskatchewan Medical Care Insurance Act. - An adjustment has been made to pay this claim as previously submitted and paid. - No further information is required. Please see correspondence from Policy Governance and Audit (PGA) if more information is required. See PGA contact information in preamble above" },
            { "RL", "The Ministry of Health performs post-JMPRC audits to ensure compliance with the Joint Medical Professional Review Committee's recommendations, and to ensure that the service codes submitted to the Ministry for payment meet the requirements as set out in the Physician Payment Schedule, the physician's Direct Payment Agreement with Medical Services Branch and The Saskatchewan Medical Care Insurance Act. - An adjustment has been made to pay this claim with the appropriate service code and rate which is different than the original claim submitted and paid. Please see correspondence from PGA if more information is required. See PGA contact information in preamble above" },
            { "RM", "Monthly stipend codes (60B, 61B, 62B) are restricted to physicians who have been approved by the College of Physicians and Surgeons of Saskatchewan to prescribe either methadone or buprenorphine/naloxone (Suboxone) for addiction and are actively supervising the patient's continuing use of methadone or buprenorphine/naloxone (Suboxone), within the provincial methadone program, based on your prescribing authority status. a) These codes are not billable for the management of patients with 'pain'; and/or b) These codes are not billable if the physician does not have current approval from the College of Physicians and Surgeons of Saskatchewan to prescribe these medications for addiction" },
            { "RN", "This service is being recovered as the result of a routine audit pertaining to the billing of a Special Care Management service code (627A, 628A). Within 30 days, please submit the name and full address of the Special Care Home or facility, in addition to the corresponding record(s). See PGA contact information in preamble" },
            { "RO", "This service is being recovered as it appears to be cosmetic in nature. Cosmetic treatments and therapies (a service to enhance appearance without being medically necessary) are not insured services. This includes any consultations or assessments provided for the provision of assessing the suitability or options for a cosmetic treatment or therapy. Physicians should not use the presence of a 'medical' element (ie: acne, medical refill) as justification to bill the publicly funded system when uninsured (cosmetic) services are the main motivation of the patient. Per the Medical Care Insurance Beneficiary and Administrative Regulations, section 10, subsection (i) and (e): For the purposes of section 15 of the Act, the following services are uninsured services: (e) plastic or other surgery for cosmetic purposes; (i) any service that is provided in conjunction with another service that is an uninsured service" },
            { "RP", "The service code(s) submitted does not appear consistent with the condition or diagnosis as described. If it was not the correct code, please resubmit the correct code with a comment on the claim. We do not require a report unless the initial code submitted was the intended service code; if so, within 30 days, please submit documents to support your billing to PGA; please see the preamble for contact information." },
            { "RQ", "Diagnostic testing must only be ordered and performed when medically required and clinically indicated. If there was a medical necessity for this testing, within 30 days, please provide an explanation regarding the clinical indication and medical necessity of the test(s) and submit the requested information to PGA; please see the preamble for contact information" },
            { "RR", "This service is being recovered as the result of a routine audit pertaining to the billing of a service that requires a referral,such as a consultation service or a diagnostic ultrasound/x-ray-,etc. We require a copy of the requisition/referral, as well as documentation that supports the service billed, such as the consultation letter or radiology report, etc. Within 30 days, please submit the requested information to PGA; please see the preamble for contact information." },
            { "RS", "This service is being recovered as it appears to be billed in conjunction with a service that is not insured by the Ministry of Health. The service(s) for which your claim has been billed in conjunction with has been reviewed through routine audit and determined to be an uninsured service. For surgery and procedures not insured by the publically funded system, the anesthetic and assistants' fees also are not insured.  Per The Medical Care Insurance Beneficiary and Administrative Regulations, section 10, subsection (i): For the purposes of section 15 of the Act, the following services are uninsured services: (i) any service that is provided in conjunction with another service that is an uninsured service" },
            { "RT", "This service is being recovered as the result of a routine audit pertaining to the billing of a technical component. Within 30 days, please submit documentation demonstrating physician ownership of equipment and/or employment of staff. See PGA contact information in preamble above" },
