            { "SB", "PHYSICIAN:  170S-171S--included in payment for retinal detachment. Re: Section 'S', item B OPTOMETRIST: A 2U or 4U has been paid to you or another optometrist during the interval between the dates given on your claim for your previous and current eye examination." },
