            { "ZG", "A premium eligible and non-premium eligible service code cannot be billed on the same claim. Please verify your locations of service and resubmit on different claims if applicable" },
            { "ZL", "PHYSICIAN: The submitted referring physician number is invalid or an invalid referring physician number has been used for a non-cancer diagnosis or a nurse practitioner has referred to a physician that is not a specialist. Please check the referring physician name and number. On occasion, the referring doctor's 4-digit number is not valid because the referring physician has not practised in Saskatchewan during the past two years. For these rare instances, resubmitting the claim using the temporary referral number 9901 may be appropriate. See 'Referral' in the 'Definitions' section of Payment Schedule for submission criteria. If appropriate, amend your claim details and resubmit through your vendor system. OPTOMETRIST: The submitted referring doctor number is invalid. Please check the referring doctor name and number. Please correct and resubmit your claim, if appropriate. Please do not query this claim in Customer Portal. DENTAL: The submitted referring doctor number is invalid or an invalid referring doctor number has been used for a non-cancer diagnosis. Please check the referring doctor name and number. Please correct and resubmit your claim, if appropriate. Please do not query this claim in Customer Portal." },
            { "ZM", "The claim contains an invalid diagnostic code according to the International Classification of Diseases - 9th Revision. Please check the diagnosis, diagnostic code and table of invalid codes. If appropriate, correct your claim details and resubmit through your vendor system." },
