            { "ZP", "PHYSICIAN: An invalid mode of payment or incorrect service code has been used on the claims or mixed services are being submitted for an APS claim (eg. 74A (SGI) and 5B or 600B). DENTAL/ OPTOMETRIST: An invalid mode of payment or incorrect service code has been used on the claim." },
